description:
Trixxx (Split Scenes)

Amia More, Inari Vachs, Candy Apples, Cheyenne Silver, Rebecca Lord, Anthony Crane, Brian Sherwood, Chris Cannon, Tony Tedeschi, Michael J. Cox, John Strong

What is reality? Is the world around us real or a fantasy pulled in front of our eyes to hide the truth??? That is what HASH (Michael J. Cox) is going to discover...When he meets JADE (Cheyenne Silver) and SERENADE (Rebecca Lord), his whole world collapses and he is introduced to reality...A reality that is somewhat not as fun as one would expect...The enslavement of humanity by a race of machines...Hidden deep under the ocean, in a submarine, a small group of rebels show him the real nature of life...Because of his special abilities he has been chosen to lead the fight and bring back man his freedom... That is if he really is who his new friends say he is... And can escape the evil agents sent to destroy him....
